import React from 'react';
import logo from '../assets/../images/m.g2.png';
import '../assets/../css/FooterNav.css';
import Homepage from './Homepage';
import About from './About';
import Contact from './Contact';
// import Cards from '../components/Cards';
import { Routes, Route, Link } from "react-router-dom";

import pic0 from '../images/pic0.jpg';
import pic1 from '../images/pic1.jpg';
import pic2 from '../images/pic2.jpg';
import pic3 from '../images/pic3.jpg';
import pic4 from '../images/pic4.jpg';
import pic8 from '../images/pic8.jpg';
import pic9 from '../images/pic9.jpg';
import pic11 from '../images/pic11.jpg';
import pic12 from '../images/pic12.jpg';
import pic13 from '../images/pic13.jpg';
import pic14 from '../images/pic14.jpg';
import pic15 from '../images/pic15.jpg';
import pic16 from '../images/pic16.jpg';
import Filtered from './earringfilter';



function Card(props) {
  const [photos] = React.useState ([{

      "image": pic0,
      "price": "9Euros",
      "name": "necklace",
      "id": 1
    },{

    "image": pic1,
    "price": "11Euros",
    "name": "earring",
    "id": 2
  },
  {
    "image": pic2,
    "price": "16Euros",
    "name": "earring",
    "id": 3
  },
  {
    "image": pic3,
    "price": "9Euros",
    "name": "ring",
    "id": 4
  },
  {
    "image": pic4,
    "price": "9Euros",
    "name": "earring",
    "id": 5
  },
  {
    "image": pic8,
    "price": "9Euros",
    "name": "bracelet",
    "id": 6
  },
  {
    "image": pic9,
    "price": "9Euros",
    "name": "earring",
    "id": 7
  },
  {
    "image": pic11,
    "price": "9Euros",
    "name": "earring",
    "id": 8
  },
  {
    "image": pic12,
    "price": "9Euros",
    "name": "ring",
    "id": 9
  },{
    "image": pic13,
    "price": "9Euros",
    "name": "ring",
    "id": 10
  },{
    "image": pic14,
    "price": "9Euros",
    "name": "necklace",
    "id": 11
  },
  {
    "image": pic15,
    "price": "9Euros",
    "name": "ring",
    "id": 12
  },{
    "image": pic16,
    "price": "9Euros",
    "name": "earring",
    "id": 13
  },])
}
function BestSellers() {
  return <div><Filtered/></div>;
}
function Earrings() {
  // return <div><Card /></div>;
}
function Bracelets() {

  // return <div><Card/></div>;
}
function Necklaces() {

  // return <div><Card/></div>;
}
function Rings() {

  // return <div><Card/></div>;
}

function Nav() {
  return (
  <section>
    <header>
      <Link to="/">
      <div className='logo' >
         <img src={logo} className="head-logo" alt="logo" />
      </div>
      </Link>
      <nav>
        <Link to="/bestSellers" className="nav-item">BestSellers</Link>
        <Link to="/earrings" className="nav-item">Earrings</Link>
        <Link to="/bracelets" className="nav-item">Bracelets</Link>
        <Link to="/necklaces" className="nav-item">Necklaces</Link>
        <Link to="/rings" className="nav-item">Rings</Link>
        <Link to="/about" className="nav-item">About us</Link>
        <Link to="/contact" className="nav-item">Contact </Link>
      </nav>
    </header>
      <Routes> 
        <Route path="/bestSellers" element={<BestSellers />} />
        <Route path="/earrings" element={<Earrings />} />
        <Route path="/bracelets" element={<Bracelets/>} />
        <Route path="/necklaces" element={<Necklaces />} />
        <Route path="/rings" element={<Rings />} />
        <Route path="/" element={<Homepage />}></Route>
        <Route path="/about" element={<About />}></Route>
        <Route path="/contact" element={<Contact />}></Route>
      </Routes>
  </section>

  );
}

export default Nav;
